public class Solution {
    public String[] solution(String[] strArr) {
        int len = strArr.length;
        for (int i=0; i<len-1; i++) {
            if (strArr[i].equals("a") &&!strArr[i+1].equals("a")) {
                int j = i + 1;
                while (!strArr[j].equals("a") && j < len - 1) {
                    j++;
                }
                String temp = strArr[i+1];
                strArr[i+1] = strArr[j];
                strArr[j] = temp;
            }
        }
        return strArr;
    }
}
